values:
yesterday was me and nicks 5 months!! so yay for that.
we went to his homecoming game and my sexy man made court! but what can i say, he is the best. I got to meet most of his friends and they were awesome. After half-time we went to wendys and after noticing that we were eating eachothers twisters we switched...yeah i def. didnt notice that there was mayo on that. I was craving chocolate so we went to this really awesome ice cream place and got a peanutbutter and a medium chocolate shakes. we shared them...it was great. we went back to my house and talked and such then ended up falling asleep waking up at about 2:00am...we're silly. 

awesome night...i lurve ya nick &hearts;
